import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(state => state.blogs)
  console.log(users)
  return(
    <div>
      <h1>Users</h1>
      {users.forEach(blog => {
        console.log(blog.user.name)
      })}
    </div>
  )
}

export default Users
